    //            "order_id": "fa9806c9-cba9-4661-9f31-8c5fd045a95d",
    //            "direction": 0,
    //            "reduce_only": false
    //        },
    //        "is_cancel": true,
    //        "reason": "post_order_failed_because_it_would_be_filled"
    //    }
    //
